import Vacancy from "../models/Vacancy";

export async function createVacancy(req, res){
    const { time, id_payment, benefits, validity_post, restaurant_id  } = req.body;
    const newTask = await Task.create({
        time, 
        id_payment,
        benefits,
        validity_post,
        restaurant_id
    }, {
        fields: ['time', 'id_payment', 'benefits', 'validity_post', 'restaurant_id']
    });
    res.json({
        message: 'New vacancy created'
    })
}

export async function getTask(req, res){
    const tasks = await Task.findAll({
        attributes: ['id', 'projectid', 'name', 'done'],
        order: [
            ['id', 'DESC']
        ]
    });
    res.json({tasks});
}

export async function updateTask(req, res){
    const { id } = req.params;
    const { projectid, name, done } = req.body;

    await Task.findOne({
        attributes: ['name', 'projectid', 'done'],
        where: {id}
    });

    const updatedTask = await Task.update({
        name,
        done,
        projectid
    }, {
        where: {id}
    });
    res.json({message: 'Task updated', updatedTask});
}

export async function deleteTask(req, res){
    const { id } = req.params;
    await Task.destroy({
        where: {
            id: id
        }
    });
    res.json({message: 'Task deleted successfully'});
}

export async function getOneTask(req, res){
    const { id } = req.params;
    const task = await Task.findOne({
        where: {id }
    });
    res.json({task});
}

export async function getTaskByProject(req, res){
    const { projectid } = req.params;
    const tasks = await Task.findAll({
        attributes: ['id', 'projectid', 'done', 'name'],
        where: { projectid }
    });
    res.json({tasks});
}

